// space.png
const space = "data:image/jpeg;base64,";


const myImage = new Image();
myImage.src = space;

let canvas;
let ctx;

let particlesArray = [];
const numberOfParticles = 5000;

let mappedImage = [];

myImage.addEventListener("load", start);


function start()
{
	canvas = document.getElementById("canvas1");
	ctx = canvas.getContext("2d");
	canvas.width = 800;
	canvas.height = 460;

	ctx.drawImage(myImage, 0, 0, canvas.width, canvas.height);

	const pixels = ctx.getImageData(0, 0, canvas.width, canvas.height);
	
	for (let y = 0; y < canvas.height; y++)
	{
		let row = [];
		for (let x = 0; x < canvas.width; x++)
		{
			const ix = (y * 4 * pixels.width) + (x * 4);
			const red = pixels.data[ix];
			const green = pixels.data[ix + 1];
			const blue = pixels.data[ix + 2];
			const alpha = pixels.data[ix + 3];
			const brightness = calcRelativeBrightness(red, green, blue);
			const cell = [
				cellBrightness = brightness,
			];
			row.push(cell);
		}

		mappedImage.push(row);
	}

	init();
	animate();
}

function calcRelativeBrightness(red, green, blue)
{
	return Math.sqrt(
		(red * red) * 0.299 +
		(green * green) * 0.587 +
		(blue * blue) * 0.114
	);
}

function animate()
{
	ctx.globalAlpha = 0.05;
	ctx.fillStyle = "rgb(0, 0, 0)";
	ctx.fillRect(0, 0, canvas.width, canvas.height);
	for (let i = 0; i < particlesArray.length; i++)
	{
		particlesArray[i].update();
		particlesArray[i].draw();
	}

	requestAnimationFrame(animate);
}

function init()
{
	for (let i = 0; i < numberOfParticles; i++)
	{
		particlesArray.push(new Particle);
	}
}

class Particle
{
	constructor()
	{
		this.x = Math.random() * canvas.width;
		this.y = 0;
		this.speed = 0;
		this.velocity = Math.random() * 0.5;
		this.size = Math.random() * 1.5 + 1;
		this.position1 = Math.floor(this.y);
		this.position2 = Math.floor(this.x);
	}

	update()
	{
		this.position1 = Math.floor(this.y);
		this.position2 = Math.floor(this.x);

		// console.log(this.position1, this.position2);
		// console.log(mappedImage[this.position1]);

		this.speed = mappedImage[this.position1][this.position2][0];

		let movement = (2.5 - this.speed) + this.velocity;

		this.y += movement;
		if (this.y >= canvas.height)
		{
			this.y = 0;
			this.x = Math.random() * canvas.width;
		}
		if (this.x >= canvas.width)
		{
			this.x = 0;
			this.y = Math.random() * canvas.height;
		}
	}

	draw()
	{
		 ctx.beginPath();
		 ctx.fillStyle = "white";
		 ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
		 ctx.fill();
	}
}
